import React from "react";
import styles from "./Footer.module.css";

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <nav className={styles.nav}>
        <a href="/">ホーム</a>
        <a href="/about">サイト説明</a>
        <a href="/disclaimer">免責事項</a>
        <a href="/privacy">プライバシーポリシー</a>
        <a href="/owner">運営者情報</a>
        <a href="https://same-sunflower-d44.notion.site/20d0d0e1f57b80bd9af2c6e925aa0c20" target="_blank" rel="noopener noreferrer">お問い合わせ</a>
        <a href="/guidelines">投稿ガイドライン</a>
        <a href="/faq">FAQ</a>
      </nav>

      <div className={styles.copyRight}>
        <small>© 2023 ファビアチェック All Rights Reserved.</small><br />
        <small>This product uses the TMDB API but is not endorsed or certified by TMDB.</small>
      </div>

      <div className={styles.tmdbLogo}>
        <a href="https://www.themoviedb.org/" target="_blank" rel="noopener noreferrer">
          <img
            src="https://www.themoviedb.org/assets/2/v4/logos/primary-blue-6e13b220a14f79f410df262a4f6c468168aa2a7e08a8f109511bdfca5e7f3d79.svg"
            alt="TMDB Logo"
            className={styles.logoImage}
          />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
